import Head from "next/Head";
import React from 'react';
import { useRouter } from 'next/router'

export async function getServerSideProps(context) {
  const { params, req, res, query, preview, previewData } = context;
  // console.log("req ", req);
  console.log("query ", query);
  const storeFetched = await fetch('https://slip.qa.smartpos.net.br/catalog/v1/loja/smartposbr').then(r => r.json());
  const store = {
    tenantId: storeFetched.id,
    code: storeFetched.codigo,
    user: storeFetched.usuario,
    fantasy: storeFetched.fantasia,
  };

  const productFetched = await fetch('https://slip.qa.smartpos.net.br/catalog/v1/loja/3957a42e-74eb-4095-a662-70c01c346689/produtos/5813').then(r => r.json());

  const product = {
    code: productFetched.codigo,
    description: productFetched.descricao,
    observation: productFetched.observacao,
    price: productFetched.valorVenda,
    tenantId: productFetched.tenant_id,
  }
  console.log(productFetched);
  // console.log(process.env);


  const q = useRouter();
  console.log('query ', q.query);


  return {
    props: {
      store,
      target: { ...product },
    },
  }
}


const Share = ({ store, target }) => {


  return (
    <>
      <Head>
        <meta name="description" content="site localhost" />
        <meta property="og:type" content="website" />
        <meta name="og:title" property="og:title" content="site localhost next js" />
        <meta name="og:description" property="og:description" content="site local host" />
        <meta property="og:site_name" content="" />
        <meta property="og:url" content="localhost:3000" />
        <meta property="og:image" content="https://images4.alphacoders.com/936/936378.jpg" />
        <meta property="og:image:alt" content="descrever imagem" />
        <meta property="og:image:type" content="image/jpeg" />
        <meta name="twitter:card" content="summary" />
        <meta name="twitter:title" content="título do tw" />
        <meta name="twitter:description" content="descricao tw" />
        <meta name="twitter:site" content="localhost:3000" />
        <meta name="twitter:creator" content="maletta" />
        <meta name="viewport" content="width=device-width, initial-scale1" />
        <meta charSet="utf-8" />
        <title>"Primeiro site next"</title>
      </Head>
      <section>
        <div className="content">SSR</div>
        <div className="content">SSR teste 2</div>

      </section>
    </>
  );
}






export default Share;
